syntax = "proto3";

option java_package = "com.inforeach.eltrader.engine.api.grpc";


message FIXFields {
    map<int32, string> stringFields = 1;
    map<int32, double> numericFields = 2;
    map<int32, RepeatingGroup> subgroups = 3;
    
    message RepeatingGroup {
        repeated FIXFields subgroup = 1;
    }
}

message ConnectionState {
    string description = 1;
    bool isConnected = 2;
    bool isOnHold = 3;
    bool isMuted = 4;
}


enum MessageIds {
    INITIAL_APP_MESSAGE_TO_COUNTER_PARTY_ID     =          0;
    MAX_APP_MESSAGE_TO_COUNTER_PARTY_ID         =  536870910;

    INITIAL_APP_MESSAGE_FROM_COUNTER_PARTY_ID   =  536870911;
